Electricity is the set of physical phenomena associated with the presence and motion of matter that has a property of electric charge. Electricity is related to magnetism, both being part of the phenomenon of electromagnetism, as described by Maxwell's equations. Various common phenomena are related to electricity, including lightning, static electricity, electric heating, electric discharges and many others. The presence of an electric charge, which can be either positive or negative, produces an electric field. The movement of electric charges is an electric current and produces a magnetic field. When a charge is placed in a location with a non-zero electric field, a force will act on it. The magnitude of this force is given by Coulomb's law. If the charge moves, the electric field would be doing work on the electric charge. Thus we can speak of electric potential at a certain point in space, which is equal to the work done by an external agent in carrying a unit of positive charge from an arbitrarily chosen reference point to that point without any acceleration and is typically measured in volts. Electricity is at the heart of many modern technologies, being used for: 
* Electric power where electric current is used to energise equipment; 
* Electronics which deals with electrical circuits that involve active electrical components such as vacuum tubes, transistors, diodes and integrated circuits, and associated passive interconnection technologies. Electrical phenomena have been studied since antiquity, though progress in theoretical understanding remained slow until the seventeenth and eighteenth centuries. The theory of electromagnetism was developed in the 19th century, and by the end of that century electricity was being put to industrial and residential use by electrical engineers. The rapid expansion in electrical technology at this time transformed industry and society, becoming a driving force for the Second Industrial Revolution. Electricity's extraordinary versatility means it can be put to an almost limitless set of applications which include transport, heating, lighting, communications, and computation. Electrical power is now the backbone of modern industrial society.

The energy industry is the totality of all of the industries involved in the production and sale of energy, including fuel extraction, manufacturing, refining and distribution. Modern society consumes large amounts of fuel, and the energy industry is a crucial part of the infrastructure and maintenance of society in almost all countries. In particular, the energy industry comprises: 
* the fossil fuel industries, which include petroleum industries (oil companies, petroleum refiners, fuel transport and end-user sales at gas stations) coal industries (extraction and processing) and the natural gas industries (natural gas extraction, and coal gas manufacture, as well as distribution and sales); 
* the electrical power industry, including electricity generation, electric power distribution and sales; 
* the nuclear power industry; 
* the renewable energy industry, comprising alternative energy and sustainable energy companies, including those involved in hydroelectric power, wind power, and solar power generation, and the manufacture, distribution and sale of alternative fuels; and, 
* traditional energy industry based on the collection and distribution of firewood, the use of which, for cooking and heating, is particularly common in poorer countries. The increased dependence during the 20th century on carbon-emitting sources of energy such as fossil fuels, and carbon-emitting renewables such as biomass, means that the energy industry has frequently been an important contributor to pollution and environmental impacts of the economy. Until recently, fossil fuels were the main source of energy generation in most parts of the world, and are a major contributor to global warming and pollution. As part of human adaptation to global warming, many economies are investing in renewable and sustainable energy.

A web hosting service is a type of Internet hosting service that hosts websites for clients, i.e. it offers the facilities required for them to create and maintain a site and makes it accessible on the World Wide Web. Companies providing web hosting services are sometimes called web hosts. Typically, web hosting requires the following: 
* one or more servers to act as the host(s) for the sites; servers may be physical or virtual 
* colocation for the server(s), providing physical space, electricity, and Internet connectivity; 
* Domain Name System configuration to define name(s) for the sites and point them to the hosting server(s); 
* a web server running on the host; 
* for each site hosted on the server: 
* space on the server(s) to hold the files making up the site 
* site-specific configuration 
* often, a database; 
* software and credentials allowing the client to access these, enabling them to create, configure, and modify the site; 
* email connectivity allowing the host and site to send email to the client.

A peripheral or peripheral device is an auxiliary device used to put information into and get information out of a computer. The term peripheral device refers to all hardware components that are attached to a computer and are controlled by the computer system, but they are not the core components of the computer, such as the CPU or power supply unit. In other words, peripherals can also be defined as devices that can be easily removed and plugged into a computer system. Several categories of peripheral devices may be identified, based on their relationship with the computer: 
* An input device sends data or instructions to the computer, such as a mouse, keyboard, graphics tablet, image scanner, barcode reader, game controller, light pen, light gun, microphone and webcam; 
* An output device provides output data from the computer, such as a computer monitor, projector, printer, headphones and computer speaker; 
* An input/output device performs both input and output functions, such as a computer data storage device (including a disk drive, solid-state drive, USB flash drive, memory card and tape drive), modem, network adapter and multi-function printer. Many modern electronic devices, such as Internet-enabled digital watches, keyboards, and tablet computers, have interfaces for use as computer peripheral devices.
